import React, { memo } from "react";
import { Route } from "react-router-dom";
import TestPage from "../pages/main/test";

const Test = memo(() => {
  return (
    <div>
      <h1>여기는 라우팅</h1>
      <Route path="/hihihi" element={<Test />} />
    </div>
  );
});

export default Test;
